import * as axios from 'axios'

export default function Github() {
    const [data, setData] = useState({})

    useEffect(() => {
        axios.get('https://api.github.com/users/dvwhitem/repos').then(res => setData(res.data))
    }, [])


    console.log(data)
    return (
        <div>
            <h1>Github Info</h1>
            <div>Repos</div>
        </div>
    )
}
